import { BrowserRouter, Route, Routes } from "react-router-dom";
import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";


function App() {
  return (
      <div className="App">
          <Navbar/>
          <Footer/>
          <BrowserRouter>
            <Routes>
              <Route path="/Home" element={<div></div>}/>
              <Route path="/Home1" element={<div></div>}/>
              <Route path="*" element={<div>h1</div>}/>
            </Routes>
          </BrowserRouter>
      </div>
  );
}

export default App;
